import React from 'react';
import gps from './../img/icons/gps.png';
import mail from './../img/icons/mail.png';
import tg from './../img/icons/telegram.png';
import wa from './../img/icons/whatsapp.png';
import phone from './../img/icons/phone.png';
import './Contacts.css';  // Подключаем стили

const Contacts = () => {
    return (
        <main className="section">
            <div className="container">
                <div className="contacts-list">
                    <div className="contact-item">
                        <img src={phone} alt="Phone" className="icon" />
                        <a href="tel:+78002001200">+7 800 200 1 200</a>
                    </div>
                    <div className="contact-item">
                        <img src={tg} alt="Telegram" className="icon" />
                        <a href="https://t.me/example" target="_blank" rel="noopener noreferrer">Написать в Телеграм</a>
                    </div>
                    <div className="contact-item">
                        <img src={wa} alt="WhatsApp" className="icon" />
                        <a href="https://wa.me/78002001200" target="_blank" rel="noopener noreferrer">Написать в WhatsApp</a>
                    </div>
                    <div className="contact-item">
                        <img src={mail} alt="Mail" className="icon" />
                        <a href="mailto:communications.russia@unilever-rus.ru">communications.russia@unilever-rus.ru</a>
                    </div>
                    <div className="contact-item">
                        <img src={mail} alt="address" className="icon" />
                        <a href="https://yandex.ru/maps/-/CDw9JJ8r">communications.russia@unilever-rus.ru</a>
                    </div>
                </div>
            </div>
        </main>
    );
};

export default Contacts;
